import StyledCovid from "./Covid.styled";

function Covid (props) {
    const {covid} = props;
    return (
        <StyledCovid>
            <div>
            <h3>{covid.status}</h3><br></br>
            <p className="covid"style={{color:covid.color}}>{covid.total}</p>
        </div>
        </StyledCovid>

    );
}

export default Covid;
